import { Navbar, Nav } from 'react-bootstrap';
import './Navigation.css';

function Navigation() {
    return (
        <Navbar className="navigation" bg="light" expand="lg">
            <Navbar.Brand href="/">SFU Community</Navbar.Brand>
        </Navbar>
    );
}

export default Navigation;
